export default function Login({ onLogin }) {
  return (
    <div className="h-screen flex justify-center items-center">
      <div className="bg-white p-8 rounded shadow w-80 text-center">
        <h2 className="font-bold mb-4">Login</h2>
        {["nick","marvel","thanos"].map(u => (
          <button key={u}
            onClick={() => onLogin(u)}
            className="w-full mb-2 bg-indigo-200 py-2 rounded">
            Login as {u}
          </button>
        ))}
      </div>
    </div>
  );
}
